INSERT INTO T7_INCIDENT VALUES('701001','Weather damage','2019-07-09','This policy requests that drivers do not call police after an accident if no serious injuries or damages occurred');
INSERT INTO T7_INCIDENT VALUES('701002','drunken driving','2014-01-20','Accidental damages or liability caused due to the driver being under the influence of alcohol is not covered by the insurance.');
INSERT INTO T7_INCIDENT VALUES('701003','mechanical breakdown','2014-01-07','Mechanical breakdown insurance covers major failures that can occur in your car, which is often excluded in basic auto insurance. Whether its bad brakes, transmission issues or electrical system or any other major vehicle system malfunctions, MBI covers the repairs to get it fixed');
INSERT INTO T7_INCIDENT VALUES('701004','self ignition','2006-11-14',"Third-party car insurance cover will pay for any fiscal liability and will also from claims arising from a third party when the insured\'s vehicle is at fault fire, explosion, self-ignition");
INSERT INTO T7_INCIDENT VALUES('701005','natural calamity','2014-11-21','A comprehensive car insurance policy provides coverage against damages or losses caused due to almost all natural disasters, which means you don\'t have to buy individual plans for each one of them.');
INSERT INTO T7_INCIDENT VALUES('701006','auto liability coverage','2015-04-09','Auto liability insurance coverage helps cover the costs of the other driver\'s property and bodily injuries if you\'re found at fault in an accident. If you have liability insurance, your insurance provider will cover costs for the driver\'s damaged car, minus your deductible, and up to your covered limit');
INSERT INTO T7_INCIDENT VALUES('701007','Floods Damage','2015-11-17', 'In case you have a basic comprehensive plan, it will cover partial losses due to flood. It will not cover loss to the engine');
INSERT INTO T7_INCIDENT VALUES('701008','damage of the engine','2019-10-21','The damage of the engine will not be covered in insurance policy');
INSERT INTO T7_INCIDENT VALUES('701009','lightning','2006-08-15','Your standard homeowners and business insurance policies, and the comprehensive portion of an auto insurance policy cover damages—such as a fire—that results from a lightning strike.');
INSERT INTO T7_INCIDENT VALUES('701010','windshield damage','2018-06-15','Windscreen damage in your vehicle would be considered a comprehensive claim. If you\'ve purchased comprehensive car insurance, it\'ll cover the damage to the windscreen; however, if you have opted for the third-party liability coverage, it will not cover damages to your car.');
INSERT INTO T7_INCIDENT VALUES('701011','burglar','2009-10-15', 'Burglary insurance policy offers compensation for loss and damage resulting from a burglary attempt in your premises');
INSERT INTO T7_INCIDENT VALUES('701012','Comprehensive Insurance','2016-04-04','Comprehensive car insurance is an extensive car insurance plan that covers the insured vehicle against third-party liabilities and own damage. It also safeguards the insured car from man-made disasters including theft, accident, incursion, burglary, fire, etc');
INSERT INTO T7_INCIDENT VALUES('701013','Personal Injury','2019-01-01','Personal accident insurance is a policy that can reimburse your medical costs, provide compensation in case of disability or death caused by accidents');
INSERT INTO T7_INCIDENT VALUES('701014','Collision Coverage','2004-08-23','Collision insurance is auto coverage that reimburses the insured for damage sustained to their personal automobile');
INSERT INTO T7_INCIDENT VALUES('701015','nuclear perils','2012-03-02', 'A nuclear hazards clause is policy language in property insurance that excludes coverage for any damage resulting from nuclear activity. The clause does not exclude normal events caused by nuclear activity, such as fires or theft');
INSERT INTO T7_INCIDENT VALUES('701016','Fire','2011-10-03','The policy delivers cover against any kind of damage caused due to a fire-related accident; however, it does not cover for damages or destruction caused to the property insured by own natural heating, fermentation, spontaneous combustion');
INSERT INTO T7_INCIDENT VALUES('701017', 'vehicle stops in the middle of the road','2019-08-19','If your vehicle stops in the middle of the road, the insurance company will come to your rescue. You will get assistance so that the vehicle can be moved to the nearest service station very easily.');
INSERT INTO T7_INCIDENT VALUES('701018','Aggravated damage','2017-07-28','Damages to provide compensation for mental distress or injury to feelings caused by the manner or motive with which a wrong was committed or by the defendant’s conduct subsequent to the wrong');
INSERT INTO T7_INCIDENT VALUES('701019','external explosion','2008-05-23',"Most home and contents insurance covers you for damage caused by fire, including bushfire. Generally, a flame has to cause the damage");
INSERT INTO T7_INCIDENT VALUES('701020','Theft','2003-10-07','Theft insurance is an insurance policy that protects against burglary, robbery and other kinds of thefts. This insurance compensates the insured from loss incurred due to theft. You can cover the risk of theft in your premises with a theft insurance policy.');
